Eine geschäftige Welt des Handels, in der das große Geschäft bis zum Beginn des 20. Jahrhunderts gedieh, war die Uferpromenade von Halifax Zeuge einiger der dramatischsten Momente Kanadas. Ein Jahrhundert später ist das Gelände immer noch ein lebendiges Ziel für Bewohner und Besucher gleichermaßen - und umfasst nun auch das frische kulinarische Ziel der Wahl für die Haligonier: The Harbour. Dieses beliebte Wochenendparadies vereint eine lebhafte Mischung aus Lebensmittelverkäufern, Musik und Getränken auf dem Segelschiff Nova Scotia's, der SS Atlantik, im Herzen des historischen Südendviertels der Innenstadt. Der Standort veranstaltet auch wöchentliche Filmabende in Zusammenarbeit mit dem beliebten Cineplex Cinemas in der Nähe des Sunnys.

